        "description": "Discusses the dynamics of the atmosphere, with emphasis on the large scale. Topics include zonally symmetric circulations and the tropical Hadley circulation; internal gravity waves; balanced flows, potential vorticity conservation and Rossby waves; stability of zonal flows; baroclinic instability and extratropical storms; tropical waves, the Walker circulation, and El NiÃ±o and the Southern Oscillation; and the role of eddies in the general circulation. Students taking graduate version complete different assignments.",
